window.bookSummaryJSON = "<p>There are three of them. Three boys. We’re friends, neighbors, our lives linked through disaster, fear, and pain.</p> <p>I love them all. Not sure I can live without them.</p> <p>Can we just stay friends? Can we ignore the desire flaring when we’re around each other? Can I kiss one and not the other?</p> <p>I can’t choose. Don’t want to choose. And I’m not sure they can, either.</p> <p>This story will either end up in heartache, or as any story should - in a happy ending.</p>"; 
